import requestAPI from "../../../util/baseUrlCustomer";

export function login(data) {
  return Authrequest({
    url: "/LoginUser/AuthUser",
    method: "post",
    data,
  });
}

export function getInfoUser(data) {
  return Authrequest({
    url: "/LoginUser/GetUserInfo",
    method: "Get",
    params: data,
  });
}
